import React from 'react';
import './home.css'

const Home = () => {
    return ( 
        <div className="homePage">
            <img className="brandLogo" src={require('./bauer.png')} alt="Bauer Hockey" />
            <img className="brandLogo" src={require('./warrior.png')} alt="Bauer Hockey" />
            <img className="brandLogo" src={require('./ccm.png')} alt="Bauer Hockey" />
            <img className="brandLogo" src={require('./sherwood.png')} alt="Bauer Hockey" />
            <img className="brandLogo" src={require('./graf.jpg')} alt="Bauer Hockey" />
        </div>
     );
}
 
export default Home
